import React, { Component } from 'react';
import { Head4 } from '../styles/Head4';

export default class CreQ extends Component {
  render() {
	return( 
		<div>
			<Head4 className="text-center text-capitalize">Hello CreQ!</Head4> 		
		</div>
	)
   }
}
